definitions.definition:
La palabra crush tiene muchos significados;
Crush se le dice principalmente a la persona que te gusta.
Crush también es el sonido de tu corazón rompiéndose

Dos besitos: Chau; 
Porque tres es mucha plata: Conformate con esto porque no te da para más. 

*Frase utilizada por la cantante "La Joaqui" en la canción "Dos Besitos"

Verbo; 
Que se define de manera vulgar a esfinar sustancias psicoactivas.
(inhalar por la nariz)
